import React from "react";
import "./hub.css"
import { NavLink } from "react-router-dom"



function Hub() {
  return <>
  <div className="container">
    <h1>Resume Builder</h1>
  <button ><NavLink className= "btn1" to="/Homepage1">Temp 1</NavLink></button>
  <button><NavLink  className= "btn" to="/Homepage2">Temp 2</NavLink></button>
  </div>
    
    
  </>
}



export default Hub;
